import React from "react";
import Popular_data from './details/Popular_data';
import Items from "./Itemsfile/Items";

function Popular() {
  return (
    <div className="container">
      <h1 className="write">Popular</h1>
      <div className="pics">
        {
          Popular_data.map((item,index) => (
            <Items 
              key={index}
              id={item.id}
              brand={item.brand_name} 
              name={item.name} 
              image={item.photo} 
              newp={item.new_price} 
              oldp={item.oldp}
            />
          ))
        }
      </div>
    </div>
  );
}

export default Popular;
